  constructor() {
    super();
    this.state = {
      sections: [
        {
          name: "Elizabeth Bagshaw",
          imageUrl: "stempics/elizabeth-bagshaw.jpg",
          id: 1,
          description:
            "Poineer of birth control and sexual education in Canada",
